widgets.filters:
JS{{
var pad = @{multixy_eq_track_@{parent.variables.n}},
       filters = []
var on = [@{eq_type_track_1_@{parent.variables.n}}, @{eq_type_track_2_@{parent.variables.n}},
          @{eq_type_track_3_@{parent.variables.n}}, @{eq_type_track_4_@{parent.variables.n}},
  @{eq_type_track_5_@{parent.variables.n}}, @{eq_type_track_6_@{parent.variables.n}},
  @{eq_type_track_7_@{parent.variables.n}},
@{eq_type_track_8_@{parent.variables.n}}],
      q = [0.75,@{eq_q_track_1_knob_@{parent.variables.n}}, @{eq_q_track_2_knob_@{parent.variables.n}},
  @{eq_q_track_3_knob_@{parent.variables.n}}, @{eq_q_track_4_knob_@{parent.variables.n}},@{eq_q_track_5_knob_@{parent.variables.n}},@{eq_q_track_6_knob_@{parent.variables.n}},0.5],
      type = ["highpass", "lowshelf", "peak", "peak", "peak", "peak", "highshelf", "lowpass"]

for (var i=0; i<pad.length; i+=2) {

filters.push({
  type: type[i/2],
  freq: pad[i],
  gain: pad[i+1],
  on: on[i/2],
  q: q[i/2]
})

}

return filters

}}

widgets.onValue:
var x = get('this')
if(x==1){
  send('/track/@{parent.variables.n}/dynamics/link', "multi mono")
}
else if(x==2){
  send('/track/@{parent.variables.n}/dynamics/link', "link all")
}
else if (x==3){
  send('/track/@{parent.variables.n}/dynamics/link', "link to 1st")
}

// Reset threshold

set('comp_thr_track_knob_@{parent.variables.n}', -30)
set('exp_thr_track_knob_@{parent.variables.n}', -60)


// Reset ratio

set('comp_ratio_track_knob_@{parent.variables.n}', 1)
set('exp_ratio_track_knob_@{parent.variables.n}', 1)


// Reset others

set('others_attack_track_knob_@{parent.variables.n}', 10)
set('others_release_track_knob_@{parent.variables.n}', 30)
set('others_lookahead_track_knob_@{parent.variables.n}', 0)
set('others_MUG_track_knob_@{parent.variables.n}', 0)


// Reset bypass

set('comp_bypass_track_@{parent.variables.n}', true)

var exp = get(this)
var comp = get('comp_thr_track_knob_@{parent.variables.n}')
if(exp >= comp){
  set(this, comp)
}

