widgets.value:
JS{{
var thr = @{comp_thr_track_knob_@{parent.variables.n}},
    rt = @{comp_ratio_track_knob_@{parent.variables.n}},
    thrBis = @{exp_thr_track_knob_@{parent.variables.n}}, // Threshold pour l'expandeur
    rtBis = @{exp_ratio_track_knob_@{parent.variables.n}}; // Ratio pour l'expandeur

// Empêcher le threshold de l'expandeur d'être supérieur à celui du compresseur
if (thrBis > thr) {
    thrBis = thr; // Ajuster le threshold de l'expandeur pour qu'il ne dépasse pas celui du compresseur
}

// Normalisation des valeurs
var thrNorm = (thr + 120) / 140; // Conversion de [-120, 20] à [0, 1]
var rtNorm = (100 - rt) / 99; // Conversion de [100, 1] à [0, 1]

var thrBisNorm = (thrBis + 120) / 140; // Conversion de [-120, 20] à [0, 1]
var rtBisNorm = (1 - rtBis) / 0.99; // Conversion de [1, 0.01] à [0, 1]

// Calcul du premier point
var xFirstPoint = thrBisNorm - (1 - rtBisNorm) * thrBisNorm; // x du premier point : proportionnel au threshold de l'expandeur
var yFirstPoint = 0; // y constant du premier point : -120 normalisé à 0

// Le deuxième point reste fixe, mais son y correspond au seuil de l'expandeur
var xSecondPoint = thrBisNorm; // x du deuxième point : reste fixe
var ySecondPoint = thrBisNorm; // y du deuxième point : fixe en fonction du seuil de l'expandeur

// Calcul de l'angle pour le compresseur
var angleCompress = thrNorm + (1 - thrNorm) * rtNorm;

// Organisation des points
var curve1 = [
  [xFirstPoint, yFirstPoint], // Premier point : se déplace le long de l'axe x, y constant
  [xSecondPoint, ySecondPoint], // Deuxième point : reste fixe en y, x correspond au seuil de l'expandeur
  [thrNorm, thrNorm], // Troisième point : transition vers le compresseur
  [1, angleCompress] // Quatrième point : compression
];

return curve1;
}}

